import { StyleSheet, View } from "react-native";
import Navbar from "./components/navbar/Navbar";
import Home from "./components/home/Home.main";

const initialPages = [
  {
    id: 1,
    pageName: "Home",
    selected: true,
  },
  {
    id: 2,
    pageName: "Add",
    selected: false,
  },
  {
    id: 3,
    pageName: "List",
    selected: false,
  },
];
export default function App() {
  const [pages, setPages] =
    React.useState <
    Array <
    { id: Number, pageName: String, selected: Boolean } >> initialPages;

  const GetSelectedPage = () =>{
    const currentPage = pages.find(page=>page.selected)
    switch(currentPage){
      case currentPage.pageName === 'Home':
        return <Home/>
    }
  } 
  return (
    <View style={styles.container}>
      {pages.find((page) => page.selected)}
      <Navbar />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#F0FFFF",
    alignItems: "center",
    justifyContent: "center",
  },
});
